import { Avatar } from "@mui/material";
import { format } from "date-fns";
import * as classes from "../../../utils/styles";
import Sidebar from "../Sidebar";
import Header from "../Header";
import Body from "./Body";
const axios = require("axios");

const GetTKB = () => {
  const apiUrl = "http://localhost:9090/api/admin/giangVien/tkb";

  const requestData = {
    maGv: "MAGV011",
    timeInputBegin: "2023-03-30",
    timeInputEnd: "2023-04-30",
  };

  axios
    .get(apiUrl, { params: requestData })
    .then((response) => {
      console.log(response.data);
    })
    .catch((error) => {
      console.error(error);
    });
  return (
    <div className="bg-[#d6d9e0] h-screen flex items-center ">
      <div className="flex bg-[#f4f6fa] w-full h-full overflow-y-hidden">
        <Sidebar />
        <div className="flex flex-col flex-1">
          <Header />
          <Body />
        </div>
      </div>
    </div>
  );
};

export default GetTKB;
